    {
        path:'/home',
        display:'Home'
    },
    {
        path:'/activity',
        display:'Activity Reservations'
    },
    {
        path:'/Cruise',
        display:'Cruise Reservations'
    }, 
];
const quick_links2=[
    {
        path:'/gallery',
        display:'Gallery'
    },
    {
        path:'/login',
        display:'Login'
    },
    {
        path:'/register',
        display:'Register'
    }, 
]


const Footer = () => {
    return (
    <footer className="footer">
        <Container>
            <Row>
                <Col lg='3'>
<div className="logo">
Vacations4You
</div>
                </Col>
            </Row>
        </Container>

    </footer>
        
        );
};

export default Footer;
